import React from "react";

function Set(){
    return(
        <div>
        <div id="mySidenav" className="sidenav">
            <a href="javascript:void(0)" className="closebtn" onClick="closeNav()">&times;</a>
            <a href="#">About</a>
            <a href="#">Services</a>
            <a href="#">Clients</a>
            <a href="#">Contact</a>
        </div>

        <h2>右侧侧边栏</h2>
        <p>点击以下菜单图标打开侧边栏，并显示在右侧。</p>
        <span style={{font_size:"30px", cursor:"pointer"}} onClick="openNav()">&#9776; 打开</span>
        </div>
    )
}

export default Set;
